import React from "react";
import { useState } from "react";

function Cart({ cart, setCart }) {
  let [price, setPrice] = useState([0]);

  return (
    <article>
        {
            cart.map((menu)=> {
                <div  className="cart_box" >
                    <div className="cart_img" key={menu.id}>
                        <img src={menu.img}/>
                        <p>{menu.name}</p>
                    </div>
                </div>
            })
        }
  </article>
  );
}

export default Cart;
